import React from 'react';
function User({ user }) {
    return(
    <div>
        <b>{user.username}</b><span>({user.email})</span>
    </div>
    )}
function UserList() {
    const users = [
        {
            id: 1,
            username: 'Viva',
            email: 'happybird00@naver.com'
        },
        {
            id: 2,
            username: 'tester',
            email: 'tester@naver.com'
        },
        {
            id: 3,
            username: 'dongwook',
            email: 'wooksker'
        }
    ];
    return (
        <div>
            {
           users.map(
               user => (<User user={user}/>)
           )}
        </div>
    )
}

export default UserList;
